import {VERIFICA_INSTRUCTOR} from "../../type"

export default (state, action) => {
    switch (action.type) {

        case VERIFICA_INSTRUCTOR:
            return {
                ...state,
                pagina: action.payload
            }

        default:
            return state;
    }
}
